import React from 'react';
import style from './App.css';
import background from './images/background.jpg';

import Navbar from './Navbar';

class App extends React.Component
{
	render()
	{
		return (
			<div styles={{backgroundImage: `url(${background})`}}>
				<Navbar/>
			</div>
		);
	}
}

export default App;
